class Solution1:
    def isPossibleToCutPath(self, grid: List[List[int]]) -> bool:
        """BFS

        If the next level has only one node and it's not the terminating level,
        return False. We have to do it two rounds, top left to bottom right and
        bottom right to top left, because trial-and-error

        Note that the queue has to be a set to avoid duplicates.

        O(N)
        """
        M, N = len(grid), len(grid[0])
        if M == N == 1:  # edge case, because we cannot take even one step
            return False
        # Top left to bottom right
        queue = set([(0, 0)])
        while queue:
            tmp = set()
            for i, j in queue:
                for di, dj in [(0, 1), (1, 0)]:
                    ni, nj = i + di, j + dj
                    if 0 <= ni < M and 0 <= nj < N and grid[ni][nj] == 1:
                        tmp.add((ni, nj))
            if (M - 1, N - 1) in tmp:
                break
            if len(tmp) <= 1:
                return True
            queue = tmp
        # Bottom right to top left
        queue = set([(M - 1, N - 1)])
        while queue:
            tmp = set()
            for i, j in queue:
                for di, dj in [(0, -1), (-1, 0)]:
                    ni, nj = i + di, j + dj
                    if 0 <= ni < M and 0 <= nj < N and grid[ni][nj] == 1:
                        tmp.add((ni, nj))
            if (0, 0) in tmp:
                break
            if len(tmp) <= 1:
                return True
            queue = tmp
        return False


class Solution2:
    def isPossibleToCutPath(self, grid: List[List[int]]) -> bool:
        """This is inspired by: https://leetcode.com/problems/disconnect-path-in-a-binary-matrix-by-at-most-one-flip/discuss/3141656/Explained-Run-DFS-2-times-oror-Very-simple-and-easy-to-Understand-Solution

        For there to be more than two non-intersecting path,
        one of them must go through (1, 0) and the other (0, 1). Thus, we go
        through (1, 0) first and flip all the cells visited to 0. We don't care
        if a path through (1, 0) reaches the destination or not. If it does not,
        we flip the cell to indicate that this is a deadend. If it does, we also
        flip it to ensure that the later attempt to go through (0, 1) will NOT
        intersect with the current path.

        A few edge cases. First, if the grid is presented in such a way that
        no cell can be flipped at all. The answer is always False.

        Second, if there is no path leading to the dest from (1, 0), the answer
        is always True.

        O(MN), 907 ms, faster than 81.05%
        """
        M, N = len(grid), len(grid[0])
        # edge cases are those where we are not allowed to make any flip.
        # such as [[1]], [[1],[1]], [[1,1]]
        if M == N == 1 or( M == 2 and N == 1) or (M == 1 and N == 2):
            return False

        def dfs(i: int, j: int) -> bool:
            if i == M - 1 and j == N - 1:
                return True
            if i < 0 or i >= M or j < 0 or j >= N or grid[i][j] == 0:
                return False
            grid[i][j] = 0
            return dfs(i + 1, j) or dfs(i, j + 1)

        if not dfs(1, 0):  # if going down cannot reach, then we can surely block it
            return True
        return not dfs(0, 1)



